import axios from "axios";
import React, { useState, useEffect } from "react";

function Main2() {
  const [hostels, setHostel] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8000/hostels")
      .then((response) => {
        setHostel(response.data);
      })
      .catch((error) => {
        console.error("Error fetching hostel:", error);
      });
  }, []);

  return (
    <div className="hostel">
      <h2 className="subheader">About</h2>
      <p className="para">
        {hostels.map((hostels) => (
          <span key={hostels.id}>
            {hostels.des}
            <br></br>
            {hostels.des1}
          </span>
        ))}
      </p>
    </div>
  );
}

export default Main2;
